import Input from './Input';
import formData from '../data/formData';

function Form() {
  formData.map((e)=>{
    return (
    <form className="flex flex-col" action="#">
      <Input
        labelName={e.labelName}
        forInput="inputName"
        typeInput="text"
        placeholderInput="e.g. Stephen King"
        /></form>)
      })}

      export default Form;
